import "./tip.css"; 
let tippic = ["./", "pic2.jpg", "pic3.jpg", "pic4.jpg", "pic5.jpg", "pic6.jpg"]; // Assuming tippic is an array of image paths
const tips = () => {
    return (
        <div id="tip">
            <div id="tip-arrow"></div>
            {tippic.map((pic, index) => (
                <div key={index} className="tip">
                    <img src={pic} alt={`Tip ${index + 1}`} />
                </div>
            ))}
        </div>
    );
};
export default tips
